using Microsoft.VisualStudio.TestTools.UnitTesting;
using System.Linq;
using WookieBooks.Controllers;
using WookieBooks.Models;

namespace WookieBooksTest
{
    [TestClass]
    public class UnitTest1
    {
        [TestMethod]
        public void Test01GetAllBooks()
        {
            var controller = new BooksController();
            var allBooks = controller.GetAllBooks();
            Assert.IsNotNull(allBooks);
        }


        
        [TestMethod]
        public void Test02GetBookById()
        {
            var controller = new BooksController();
            var book = controller.GetBookById(1);
            Assert.IsNotNull(book);
            Assert.AreEqual("Barack Obama", book.Author);
            Assert.AreEqual(34.99f, book.Price);
        }


        [TestMethod]
        public void Test03GetBookByValidAuthor()
        {
            var controller = new BooksController();
            var books = controller.GetBooksByAuthor("Tony Faggioli");
            Assert.IsNotNull(books);
            Assert.AreEqual(1, books.Count);
            Assert.AreEqual(24.99f, books[0].Price);
        }

        [TestMethod]
        public void Test04DeleteOneGetAll()
        {
            var controller = new BooksController();
            var response = controller.DeleteBookById(2);
            Assert.AreEqual(true, response.IsSuccess);
            var books = controller.GetAllBooks();
            Assert.IsNotNull(books);
            Assert.AreEqual(1, books.Count);
        }

        [TestMethod]
        public void Test05AddOneGetAll()
        {
            var controller = new BooksController();
            Book newBook = new Book()
            {
                Id=0,
                Author= "Daniel Kahneman",
                Title= "Thinking, Fast and Slow",
                Description= "Major New York Times bestseller. Winner of the National Academy of Sciences Best Book Award in 2012",
                Price=20.56f,
                ImageData= ""
            };
            var response = controller.AddBook(newBook);
            Assert.AreEqual(true, response.IsSuccess);
            var books = controller.GetAllBooks();
            Assert.IsNotNull(books);
            Assert.AreEqual(2, books.Count);
        }

        [TestMethod]
        public void Test06AddOneDeleteByAuthorGetAll()
        {
            var controller = new BooksController();
            Book newBook = new Book()
            {
                Id = 0,
                Author = "Daniel Kahneman",
                Title = "Noise",
                Description = "From the bestselling author of Thinking, Fast and Slow, the co-author of Nudge, and the author of You Are About to Make a Terrible Mistake! comes Noise, a groundbreaking exploration of why people make bad judgments, and how to control both noise and cognitive bias.​",
                Price = 29.56f,
                ImageData = ""
            };
            var response = controller.AddBook(newBook);
            Assert.AreEqual(true, response.IsSuccess);
            response = controller.DeleteBookByAuthor("Daniel Kahneman");
            Assert.AreEqual(true, response.IsSuccess);
            var books = controller.GetAllBooks();
            Assert.IsNotNull(books);
            Assert.AreEqual(1, books.Count);
        }

