        [TestMethod]
        public void Test12GetBookByInvalidId()
        {
            try
            {
                var controller = new BooksController();
                var books = controller.GetBookById(5);
                Assert.Fail();
            }
            catch
            {
                Assert.IsTrue(true);
            }
        }

        [TestMethod]
        public void Test13UpdateOneGetAll()
        {
            var controller = new BooksController();
            Book newBook = new Book()
            {
                Id = 1,
                Author = "Barack Obama",
                Description = "A Promised Land is a memoir by Barack Obama, the 44th President of the United States from 2009 to 2017",
                ImageData = "",
                Price = 30.99f,
                Title = "A Promised Land"
            };
            var response = controller.UpdateBook(1,newBook);
            Assert.AreEqual(true, response.IsSuccess);
            var books = controller.GetAllBooks();
            Assert.IsNotNull(books);
            Assert.AreEqual(30.99f, books.Where(x=>x.Id==1).First().Price);
        }

